import React from 'react'
import Logo from './logo';
const Nav = () =>{
    return(
        <nav>
        <Logo/>
            <ul>
            <li><a href='#'>Profile</a></li>
            <li><a href='#'>About Me</a></li>
            <li><a href='#'>Resume</a></li>
            <li><a href='#'>Skills</a></li>
            </ul>
        </nav>
    );
}



export default Nav;
